import React, { useState } from 'react';
import axios from 'axios';
import { Line } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
} from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

function StockData() {
    const [symbol, setSymbol] = useState('');
    const [data, setData] = useState(null);
    const [error, setError] = useState('');
    const [chartData, setChartData] = useState(null);

    // Fetch data from backend
    const fetchStockData = async () => {
        if (!symbol) {
            setError('Please enter a stock symbol.');
            return;
        }
        try {
            const response = await axios.get(`http://localhost:5000/stock/${symbol}`);
            const stockData = response.data;
            setData(stockData);
            setError('');

            setChartData({
                labels: ['Previous Close', 'Open', 'High', 'Low', 'Current'],
                datasets: [
                    {
                        label: `${symbol.toUpperCase()} Stock Prices`,
                        data: [
                            stockData.previousClose,
                            stockData.openPrice,
                            stockData.highPrice,
                            stockData.lowPrice,
                            stockData.currentPrice,
                        ],
                        borderColor: 'rgba(75, 192, 192, 1)',
                        backgroundColor: 'rgba(75, 192, 192, 0.2)',
                    },
                ],
            });
        } catch (err) {
            console.error('Error fetching data:', err.message);
            setError('Failed to fetch data. Please try again later.');
        }
    };

    return (
        <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif', maxWidth: '800px', margin: 'auto' }}>
            <h1 style={{ textAlign: 'center', marginBottom: '20px' }}>Real-Time Stock Data Viewer</h1>
            <div style={{ display: 'flex', justifyContent: 'center', marginBottom: '20px' }}>
                <input
                    type="text"
                    placeholder="Enter Stock Symbol (e.g., AAPL)"
                    value={symbol}
                    onChange={(e) => setSymbol(e.target.value)}
                    style={{
                        padding: '10px',
                        width: '300px',
                        marginRight: '10px',
                        borderRadius: '5px',
                        border: '1px solid #ccc',
                    }}
                />
                <button
                    onClick={fetchStockData}
                    style={{
                        padding: '10px 20px',
                        borderRadius: '5px',
                        border: 'none',
                        backgroundColor: '#007BFF',
                        color: 'white',
                        cursor: 'pointer',
                    }}
                >
                    Fetch Data
                </button>
            </div>
            {error && <p style={{ color: 'red', textAlign: 'center' }}>{error}</p>}
            {data && (
                <div style={{ marginTop: '20px' }}>
                    <h2 style={{ textAlign: 'center' }}>Stock Data for {symbol.toUpperCase()}</h2>
                    <ul style={{ listStyleType: 'none', padding: 0, textAlign: 'center' }}>
                        <li><strong>Current Price:</strong> ${data.currentPrice}</li>
                        <li><strong>High Price:</strong> ${data.highPrice}</li>
                        <li><strong>Low Price:</strong> ${data.lowPrice}</li>
                        <li><strong>Open Price:</strong> ${data.openPrice}</li>
                        <li><strong>Previous Close:</strong> ${data.previousClose}</li>
                    </ul>
                </div>
            )}
            {chartData && (
                <div style={{ marginTop: '20px' }}>
                    <Line
                        data={chartData}
                        options={{
                            responsive: true,
                            plugins: {
                                legend: {
                                    position: 'top',
                                },
                                title: {
                                    display: true,
                                    text: `Stock Prices for ${symbol.toUpperCase()}`,
                                },
                            },
                        }}
                    />
                </div>
            )}
        </div>
    );
}

export default StockData;
